●HAKOYA（ハコヤ） COLLECTIONシリーズです。<br><br>●シンプルで落ち着いたデザインの男性用2段式お弁当箱です。<br><br>●食べ終わった後、中身を反転させればコンパクトに持ち帰り・収納できます。<br><br>●上段（おかず入れ）はシール蓋付きで、汁もれの心配が少なく安心です。<br><br>●ゴムバンド付きです。<br><br>●電子レンジによる加熱、食器洗い乾燥機使用OKです。<br><br>●父の日・お誕生日のプレゼントなどにも喜ばれます。<br><br><table width="500" border="0" align="left" cellpadding="3" cellspacing="1" bgcolor="#CCCCCC" style="font-size:13px; color:#333333;"><tr bgcolor="#FFFFFF"><td width="58">サイズ</td><td>約 幅18.0×奥行10.3×高さ8.4（cm）</td></tr><tr bgcolor="#FFFFFF"><td width="58">材質</td><td>PET樹脂</td></tr><tr bgcolor="#FFFFFF"><td width="58">容量</td><td>約 900(ml)（上段：450ml、下段：450ml）<br>シール蓋、ランチバンド付</td></tr><tr bgcolor="#FFFFFF"><td width="58">カラー</td><td>溜（茶）</td></tr><tr bgcolor="#FFFFFF"><td width="58">生産国</td><td>日本</td></tr><tr bgcolor="#FFFFFF"><td width="58">備考</td><td>※中蓋は電子レンジ・食洗機対応ではありません。必ずはずしてご使用下さい。</td></tr></table><table width="600" border="0" cellpadding="10">
