<b>■在庫確保について</b><br><br>

当該商品は他モール等での販売と在庫を共有しているため、在庫更新のタイミングにより、
在庫切れの場合やむをえずキャンセルさせていただく可能性がございます。<br><br>

また、テレビなどのメディア掲載直後、自然災害など不測の事態発生などにより、需要が急激に高まり、在庫のご用意が出来ない場合が
ございます。その場合もキャンセルとさせていただく可能性がございます。<br><br>

その他にも、メーカー欠品などにより、納期情報記載の納期以上にお時間がかかってしまう場合がございますが、その場合は
御連絡させて頂いたうえで、再入荷予定がある場合は、そのままお待ち頂くか、キャンセルして頂くかご検討頂きます。再入荷
予定がない場合は、代替商品のご提案させて頂く場合や、キャンセルをさせて頂く場合がございます。<br><br>

お急ぎの場合は恐れ入りますが、ご注文前にご希望商品と数量と必要な期日をお問合せ頂けましたら
お調べ致しますので、お気軽にお尋ね下さい。<br><br>

<b>■ご注文後のご注文内容のキャンセル、修正について</b>
<br><br>
本商品はご注文タイミングやご注文内容によっては、購入履歴からのご注文キャンセル、
修正を受け付けることができない場合がございます。ご注文内容変更をご希望の際は
お気軽に当店までメール、またはお電話にてご連絡頂けましたら、ご対応致します。<br><br>

（ただし、発送手配が既に完了している場合、キャンセルがお受けできない可能性
がございますので、変更がございます場合は、お早目にお願い致します）<br><br>

<b>■ご注文後にメールが届かない場合について</b>
<br><br>
原則、ご注文の当日、または翌営業日（土日祝除く）の午前中までには当店よりご注文確認メールをお送りしておりますが、
メール便受信時に、携帯電話やメールの設定により受信がブロックされている事例がございます。
また、迷惑メールフォルダに振り分けされていることも多いため、メールが届かない場合は、必ず一度受信設定をご確認ください。
<br><br>
※当店の送信時のメールアドレスは「point10@shop.rakuten.co.jp」となります。<br>
※受信設定の操作方法がご不明な場合は、お手数ですがご利用端末、もしくはメールソフト提供元にご確認願います。<br>
<br>

もしどうしても当店からのメールのご確認が出来ない場合は、お問合せ頂けましたらお調べ
致しますので、お気軽にお尋ね下さい。<br><br>

■お問合せメール： point10@shop.rakuten.co.jp<br>
■お問合せ電話番号： 06-6131-5940（土日祝除く9時～17時）<br><br>
