ランチバッグ付きで、お弁当箱をすっきり収納！<br>
フォーク＆ケースも付いて、持ち運びが便利♪<br>
バッグの内ブタには、ふりかけなどが入れられる<br>
メッシュポケット付き☆彡<br>
<br>
※菜入れ容器は、フタを外して電子レンジＯＫ！<br>
※保温ジャーは、電子レンジ使用不可となります。<br>
<br>
<font color="#0000cd">
◆本品は、食洗機、乾燥機の使用は出来ません。</font><br><br>
■セット内容<br>
・ご飯入れ(240ml／ステンレス保温ジャー)<br>
　【お茶碗 約1.2杯分（目安：茶碗１杯＝200ml)】<br>
・菜入れ(160ml×２個)<br>
　【おかずが"ふわっ"と盛れておいしさＵＰ！】<br>
・ランチバッグ<br>
　【バッグは丸洗いできませんので、汚れた場合は<br>
　　柔らかい布等で拭き取って下さい。】<br>
・フォーク＆ケース<br>
<br>
※保温効力５４度以上（６時間）<br>
<br>
○総容量：560ml<br>
○商品サイズ：約90×173×130mm<br>
<br>
≪品質表示≫<br>
◆保温ジャー<br>
・本体：ステンレス鋼（アクリル樹脂塗装)<br>
・フタ：ポリプロピレン(発泡スチロール）<br>
・パッキン：シリコーン<br>
・底板：エラストマー樹脂<br>
◆菜入れ<br>
・本体：ポリプロピレン／耐熱温度140度<br>
・フタ：ポリエチレン／耐熱温度70度<br>
◆フォーク＆ケース<br>
・フォーク先：ステンレス鋼<br>
・フォーク柄：ＡＢＳ樹脂／耐熱温度80度<br>
・ケース本体：ＡＢＳ樹脂／耐熱温度80度<br>
・フタ：ＡＳ樹脂／耐熱温度80度<br>
◆ランチバッグ：ポリエステル<br>
・中材：発泡ポリエチレン<br>
